import React from 'react';
import './App.css';

const App = () => {
	return (
		<div className='w-full'>
			<Navbar />
			<MeetupNow />
			<NextMeetup />
		</div>
	);
}

function Navbar() {
	return (
		<div className="navbar bg-base-300">
			<div className="flex-none">
				<a className="btn btn-ghost normal-case text-xl" href='#'>QTemu</a>
			</div>
			<div className="flex-1">
				<ul className="menu menu-horizontal p-0">
					<li><a href='#'>Create Meetup</a></li>
					<li><a href='#'>Explore</a></li>
				</ul>
			</div>
			<div className="navbar-end">
				<a href='#'>login</a>
			</div>
		</div>
	);
}

function MeetupNow() {
	return (
		<div className="flex bg-slate-500 m-3">
			<div id='img-main' className="bg-slate-600 h-48 w-48 m-5"></div>
			<div id='meetup-desc' className="m-5">
				<h1 id='title-meetup-main' className="text-2xl font-bold mb-2">Hacktiv8 Meetup</h1>
				<p className="mb-2 text-lg">Location &emsp;&emsp;Jakarta,Indonesia</p>
				<p className="mb-2 text-lg">Merbers	&emsp;&emsp;1,078</p>
				<p className="mb-2 text-lg">Organizers &emsp;	Adhy Wiranata</p>
				<button class="btn rounded-none w-36">Join Us</button>
			</div>
		</div>
	)
}

function NextMeetup() {
	return (
		<div>
			<h2>Next Meetup</h2>
			<div className="flex">
				<div className="mx-auto container w-11/12 bg-slate-500 p-4">
					<h4>Awesome meetup and event</h4>
					<p>25 January 2019</p>
				</div>
			</div>
		</div>
	)
}

export default App;
